import React from "react";
import { useSelector } from "react-redux";

import { Modal } from "antd";
import { useDispatch } from "react-redux";
import "./Recipe.css";

const ReturnModal = () => {
  const dispatch = useDispatch();
  const { detailRecipe, status } = useSelector((state) => state.detailRecipe);

  console.log("detailRecipe: ", detailRecipe);

  const cancelHandle = () => {
    dispatch({ type: "CLOSE_RECIPE" });
  };

  return (
    <Modal
      wrapClassName=""
      visible={status}
      onCancel={cancelHandle}
      footer={null}
    >
      {/* <div>{detailRecipe?.publisher}</div> */}
      <div
        style={{ width: "500px", height: "300px", backgroundColor: "red" }}
      ></div>
      <div style={{ width: "400", backgroundColor: "blue" }}></div>
    </Modal>
  );
};

export default ReturnModal;
